import {useEffect , useState} from 'react';


function Profile(props: any){
    const[items , setitems] = useState([])
    useEffect(() => {
        setitems(props.data?.items)
      }, [props]);
   
    return(
        <div>
            <h1>{}</h1>
             <img src={props.data?.items.profile_image} alt="profile_image" ></img>
            <h1>1</h1>
        </div>
    )
}

export default Profile;
